function isBear(block, row, col){
    if(block === 0){
        if(row === 2 && col === 3){
            return true;
        }
        else if(row === 2 && col === 4){
            return true;
        }
        else if(row === 2 && col === 5){
            return true;
        }
    }
    
    else if(block === 4){
        if(row === 2 && col === 4){
            return true;
        }
        else if(row === 1 && col === 5){
            return true;
        }
        else if(row === 2 && col === 5){
            return true;
        }
    }

    else if(block === 5){
        if(row === 0 && col === 0){
            return true;
        }
        else if(row === 1 && col === 0){
            return true;
        }
    }

    else if(block === 6){
        if(row === 0 && col === 0){return true;}
        else if(row === 0 && col === 1){return true;}
        else if(row === 0 && col === 2){return true;}
    }

    else if(block === 10){
        if(row === 0 && col === 0){return true;}
        else if(row === 0 && col === 1)return true;
        else if(row === 1 && col === 0) return true;
    }

    else if(block === 11){
        if(row === 1 && col === 5)return true;
        else if(row === 2 && col === 5)return true;
    }

}

function isCougar(block, row, col){
    if(block === 1){
        if(row === 0 && col === 0){
            return true;
        }
        else if(row === 0 && col === 1){
            return true;
        }
        else if(row === 0 && col === 2){
            return true;
        }
    }

    else if(block === 2){
        if(row === 1 && col === 0){
            return true;
        }
        else if(row === 1 && col === 1){
            return true;
        }
        else if(row === 2 && col === 0){
            return true;
        }
    }

    else if(block === 3){
        if(row === 1 && col === 5){
            return true;
        }
        else if(row === 2 && col === 5){
            return true;
        }
    }

    else if(block === 7){
        if(row === 2 && col === 3){
            return true;
        }
        else if(row === 2 && col === 4){
            return true;
        }
        else if(row === 2 && col === 5){
            return true;
        }
    }

    else if(block === 8){
        if(row === 0 && col === 5){return true;}
        else if(row === 1 && col === 4){return true;}
        else if(row === 1 && col === 5){return true;}
    }

    else if(block === 9){
        if(row === 0 && col === 0){return true;}
        else if(row === 1 && col === 0){return true;}
    }
}
